import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import Router and Route
import './styles.css'; // Import your global styles
import App from './App'; // Main app component that includes SurahList
import SurahList from './SurahList'; // Import your SurahList component

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Switch>
        {/* Default route for your SurahList page */}
        <Route exact path="/" component={SurahList} />
        {/* You can add more routes here if needed */}
      </Switch>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);
